import React, { Component } from 'react';
import axios from 'axios';

export default class AddAttraction extends Component {
    constructor(props) {
        super(props);

        this.onChangeName = this.onChangeName.bind(this);
        this.onChangeImageUrl = this.onChangeImageUrl.bind(this);
        this.onChangeDescription = this.onChangeDescription.bind(this);
        this.onChangeLocation = this.onChangeDescription.bind(this);
        this.onChangeAddress = this.onChangeAddress.bind(this);
        this.onChangeCity = this.onChangeCity.bind(this);
        this.onChangeState = this.onChangeState.bind(this);
        this.onChangeZipcode = this.onChangeZipcode.bind(this);
        

        this.state = {
            name: '',
            imageUrl: '',
            description: '',
            location: {
                address: '',
                city: '',
                state: '',
                zipcode: ''
            },
        }
    }

    onChangeName(e) {
        this.setState({
            name: e.target.value
        });
    }
    onChangeImageUrl(e) {
        this.setState({
            imageUrl: e.target.value
        });
    }
    onChangeDescription(e) {
        this.setState({
            description: e.target.value
        });
    }
    onChangeAddress(e) {
        this.setState({
            location:{
            address: e.target.value
            } 
        });
    }
    onChangeCity(e) {
        this.setState({
            location:{
             city: e.target.value   
            }
        });
    }
    onChangeState(e) {
        this.setState({
            location:{
             state: e.target.value   
            }
        });
    }
    onChangeZipcode(e) {
        this.setState({
            location:{
              zipcode: e.target.value  
            }
        });
    }

    onSubmit(e) {
        e.preventDefault();

        const attraction = {
            name: this.state.name,
            imageUrl: this.state.imageUrl,
            description: this.state.description,
            location: this.state.location,
            address: this.state.address,
            city: this.state.city,
            state: this.state.state,
            zipcode: this.state.zipcode
        }

        console.log(attraction);
        axios.post('http://localhost:5000/attractions/add', attraction)
        .then(res => console.log(res.data));
    }

    
    render() {
        return (
            <div>
                <h3>Add New Attraction</h3>
                <form onSubmit={this.onSubmit}>
                    <div className="form-group">
                        <label>Attraction Name: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.name}
                        onChange={this.onChangeName} />
                    </div>
                    <div className="form-group">
                        <label>Image URL: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.imageUrl}
                        onChange={this.onChangeImageUrl} />
                    </div>
                    <div className="form-group">
                        <label>Description: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.description}
                        onChange={this.onChangeDescription} />
                    </div>
                    <div className="form-group">
                        <label>Address: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.location.address}
                        onChange={this.onChangeAddress} />
                    </div>
                    <div className="form-group">
                        <label>City: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.location.city}
                        onChange={this.onChangeCity} />
                    </div>
                    <div className="form-group">
                        <label>State: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.location.state}
                        onChange={this.onChangeState} />
                    </div>
                    <div className="form-group">
                        <label>Zipcode: </label>
                        <input type="text"
                        required
                        className='form-control'
                        value={this.state.location.zipcode}
                        onChange={this.onChangeZipcode} />
                    </div>
                    <div className="form-group">
                        <input type="submit" value='Add New Attraction' className='btn btn-primary' />
                    </div>
                </form>
            </div>
        )
    }
}
